import React from 'react';

function Highziumstudio() {
	return (
		<div className="page">
			<h1>Highzium Studio</h1>
			<div className="content">
				<h2>프로젝트 소개</h2>
				<p>Highzium Studio는 게임 개발 스튜디오 브랜딩 프로젝트입니다.</p>

				<h3>주요 작업 내용</h3>
				<ul>
					<li>게임 스튜디오 브랜딩</li>
					<li>UI/UX 디자인</li>
					<li>게임 캐릭터 디자인</li>
					<li>웹사이트 및 앱 디자인</li>
				</ul>

				<h3>사용 기술</h3>
				<p>Adobe Creative Suite, Unity, Figma</p>
			</div>
		</div>
	);
}

export default Highziumstudio;
